(50, 'OgUAXk2c5O', 'Les astuces pour faire face aux dÃ©couragement ', 'individual-interview-full.jpg', 'COMMENT FAIRE FACE AU DÃ‰COURAGEMENT ?\r\n\r\nLa vie nâ€™est pas toujours un long fleuve tranquille, elle est un sentier parsemÃ© dâ€™Ã©pines, dâ€™embÃ»ches, de profondes et dâ€™effroyables frustrations. Seules peuvent Ãªtre tÃ©moins de notre ascension, les diffÃ©rentes vicissitudes par lesquelles nous sommes passÃ©s. La vÃ©ritable leÃ§on de vie nâ€™est pas de nâ€™Ãªtre jamais tombÃ©, de ne sâ€™Ãªtre jamais trompÃ©, mais la clÃ© de toute vie empreinte de victoire est la capacitÃ© de se relever aprÃ¨s un Ã©chec, et surtout dâ€™Ãªtre prÃ©disposÃ© Ã  sâ€™amÃ©liorer.\r\n\r\nEn tant quâ€™humains, il serait dÃ©loyal de feindre certaines douleurs sous le voile dâ€™un pseudo stoÃ¯cisme. Votre douleur vous ne pourrez la cacher assez longtemps, votre douleur est une partie de vous, car elle vous appartient Ã  vous seul. Les autres peuvent avoir des douleurs ou des frustrations semblables aux vÃ´tres, mais vous Ãªtes seul Ã  pouvoir sucer de leurs venins.\r\n\r\nVoyez-vous, ma vie et mon parcours mâ€™ont assez instruit, et je ne prÃ©tends pas avoir dÃ©jÃ  atteint le niveau de connaissances ou de compÃ©tence que je souhaite vivement atteindre, car je suis encore trÃ¨s mÃ©diocre. \r\n\r\nCrier ses douleurs ou hurler ses peines, ce nâ€™est pas Ãªtre lÃ¢che ou faible, câ€™est Ãªtre humain. Vider son gosier pour externaliser ses frustrations ne fait pas de vous un poltron, non, ceci fait de vous un homme vivant et conscient de ses peines.\r\n\r\nQuelquefois vous nâ€™avez toujours pas besoin de motivation ou de paroles dâ€™encouragements pour sortir de votre zone de confort ou au mieux pour lâ€™Ã©largir, vous avez simplement besoin de rÃ©pandre au dehors cette frustration qui vous pollue la pensÃ©e. Sâ€™il sâ€™agit de pleurer, faites-le. Sâ€™il sâ€™agit de vous reposer un instant, faites-le. Sâ€™il est plutÃ´t question de vous ouvrir Ã  quelquâ€™un, faites-le.\r\n\r\nMais ce que vous devez savoir, câ€™est que les douleurs, Ã§a fait partie du processus de croissance et de maturitÃ© de toute personne. Il nâ€™est aucun homme qui ait commencÃ© Ã  marcher sans jamais trÃ©bucher. Donc Ã©chouer, trÃ©bucher, gÃ©mir, sentir le dÃ©sir dâ€™abandon, câ€™est normal, Ã§a prouve mieux encore que vous pouvez prendre conscience de vos faiblesses et vous amÃ©liorer.\r\n\r\nEt si je vous disais que les plus belles leÃ§ons de la vie sont celles que nous avons apprises dans les douleurs, les peines, lâ€™angoisse et les trahisons ; que me direz-vous ? Oui en effet, la vie est une succession de leÃ§ons qui doivent Ãªtre vÃ©cues pour Ãªtre comprises. Donc ne mÃ©prisez plus vos souffrances, elles sont les jalons dâ€™une nouvelle destinÃ©e de gloire.\r\n\r\nIl est vrai quâ€™un objectif manquÃ©, une affaire plombÃ©e et des voiles obscurs sur lâ€™avenir, Ã§a crÃ©e le doute, lâ€™incertitude et par consÃ©quent le dÃ©couragement ; mais vous devez pouvoir comprendre que tous ces signaux reprÃ©sentent des lanternes qui Ã©clairent votre sentier.\r\n\r\nOn est pas trÃ¨s fort pour nâ€™Ãªtre jamais tombÃ©, mais on est trÃ¨s fort pour avoir portÃ© en soi lâ€™audace de continuer malgrÃ© les turpitudes. Et câ€™est ce qui fait de vous un vÃ©ritable gagnant. Avant de vous dÃ©courager et vouloir jeter lâ€™Ã©ponge, posez-vous la question Ã  savoir : QUI SONT CEUX QUI ME REGARDENT COMME UN MODÃˆLE ? Cette question seule est un vÃ©ritable carburant pour vous amener Ã  ne rien laisser tomber. Car lorsquâ€™on a atteint une certaine influence et une certaine crÃ©dibilitÃ©, on ne sâ€™appartient plus, mais on devient comme quelquâ€™un le disait FILS DE LA TERRE.\r\n\r\nCroyez-en vous. Osez quelque de diffÃ©rent et dâ€™audacieux, marchez confiant vers votre destinÃ©e. Et surtout souriez beaucoup car câ€™est ainsi quâ€™on gagne vraiment en confiance et en positivitÃ©, surtout en expÃ©riences qui vous enrichissent. Si voulez vraiment vaincre LE DÃ‰COURAGEMENT, SOURIEZ Ã  chacun de vos Ã©checs, remettez-vous en cause, amÃ©liorez-vous et RECOMMENCEZ.', 'evÃ©nements', 'Comment faire face aux dÃ©couragement ?', '2023-05-02 12:00:04', 1),
(51, 'TT2Ft8HoJD', 'Le grand secret de ceux qui rÃ©ussissent.', 'Aaabadinercouple.jpg', 'Â« Le secret de votre rÃ©ussite est la personne que vous Ã©pousez Â» \r\nâ€“les psychologuesâ€“\r\n\r\nQue vous le rÃ©alisiez ou non, votre rÃ©ussite et vos perspectives dans la vie peuvent Ã©galement dÃ©pendre des personnes avec lesquelles vous vous entourez.\r\n\r\nMais la science va encore plus loin.\r\n\r\nSelon les chercheurs, votre succÃ¨s peut Ã©galement dÃ©pendre de la personne que vous Ã©pousez.\r\n\r\nUne Ã©tude rÃ©cemment publiÃ©e Ã  l\'UniversitÃ© Carnegie Mellon montre que les conjoints peuvent grandement influer sur les dÃ©cisions que vous prenez, contribuant finalement Ã  votre succÃ¨s ou Ã  votre Ã©chec.\r\n\r\nAlors choisissez bien et minutieusement votre conjoint(e)', 'evolution', 'Un grand secret de ceux qui ont rÃ©ussi ', '2023-05-05 10:40:48', 1);
